import {
  ElementRef,
  OnInit,
  ChangeDetectorRef,
  ViewChild,
  ChangeDetectionStrategy,
  Component,
} from "@angular/core";
import { ActivatedRoute, Router } from "@angular/router";
import { marker as _ } from "@biesbjerg/ngx-translate-extract-marker";
import { Apollo, gql } from "apollo-angular";
import { TypedBaseListComponent } from "@vendure/admin-ui/core";
import {
  CompletedOrder,
  GetCompletedOrderDocument,
  GetRefundListDocument,
} from "../../gql/graphql";
import jsPDF from "jspdf";
import writeXlsxFile from "write-excel-file";
import * as pdfMake from "pdfmake/build/pdfmake";
import * as pdfFonts from "pdfmake/build/vfs_fonts";

(<any>pdfMake).vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: "vdr-stock-report",
  templateUrl: "./new-sales-report.component.html",
  styleUrls: ["./new-sales-report.component.scss"],
  changeDetection: ChangeDetectionStrategy.OnPush,
})
export class NewSalesReportComponent extends TypedBaseListComponent<
  typeof GetCompletedOrderDocument,
  "getCompletedOrder"
> {
  @ViewChild("formattedPdf", { static: true }) formattedPdf: ElementRef;
  @ViewChild("myInput") myInputRef: ElementRef;

  excelLoading: boolean = false;
  salesListIsLoading: boolean = false;
  salesList: CompletedOrder[] = [];

  readonly filters = this.createFilterCollection()
    .addDateFilters()
    .addFilter({
      name: "state",
      type: {
        kind: "select",
        options: [
          {
            value: "PaymentSettled",
            label: "payment Settled",
          },
          {
            value: "Shipped",
            label: "shipped",
          },
          {
            value: "Delivered",
            label: "delivered",
          },
        ],
      },
      label: "State",
      filterField: "state",
    })
    .connectToRoute(this.route);

  constructor(
    router: Router,
    route: ActivatedRoute,
    private apollo: Apollo,
    private cdr: ChangeDetectorRef,
    private elRef: ElementRef,
  ) {
    super();
    super.configure({
      document: GetCompletedOrderDocument,
      getItems: (data) => data.getCompletedOrder,
      setVariables: (skip, take) => ({
        options: {
          skip,
          take,
          filter: {
            ...this.filters.createFilterInput(),
          },
        },
      }),

      refreshListOnChanges: [this.filters.valueChanges],
    });
  }

  async generateXl(sale: any) {
    this.salesListIsLoading = true;

    this.getValue(sale);
    this.cdr.detectChanges();
    if (this.salesList.length != 0) {
      this.excelLoading = true;
      const colNames: string[] = [
        "id",
        "createdAt",
        "updatedAt",
        "customerId",
        "code",
        "state",
        "active",
        "orderPlacedAt",
        "subTotal",
        "subTotalWithTax",
        "shipping",
        "shippingWithTax",
        "type",
      ];

      const values: object[][] = [];
      const cols: object[] = [];
      for (const col of colNames) {
        cols.push({
          value: col,
        });
      }
      values.push(cols);
      for (const _customer of this.salesList) {
        const row: object[] = [];
        for (const colName of colNames) {
          row.push({
            value: _customer[colName],
          });
        }
        values.push(row);
      }
      await writeXlsxFile(values, {
        fileName: `${new Date().toDateString()} sale report.xlsx`,
      });
      this.excelLoading = false;
      this.cdr.detectChanges();
    }
  }

  getValue(sale: any) {
    const inputValue = this.myInputRef.nativeElement.value;
    sale.subscribe((sale) => {
      this.salesList = sale;
      this.cdr.detectChanges();
    });
  }

  async generatePdfByMake(sale: any) {
    this.getValue(sale);
    this.cdr.detectChanges();

    if (this.salesList.length > 0) {
      const fromDate = this.salesList[this.salesList.length - 1].createdAt;
      const toDate = this.salesList[0].createdAt;
      const tableBody = this.salesList.map((order) => [
        order.createdAt.substring(0, 10),
        order.shippingAddress?.fullName,
        order.code,
        order.state,
        parseFloat(order.subTotalWithTax!) / 100 + "ETB",
        parseFloat(order.shippingWithTax!) / 100 + "ETB",
        parseFloat(order.subTotalWithTax!) / 100 +
          parseFloat(order.shippingWithTax!) / 100 +
          "ETB",
      ]);
      const documentDefinition = {
        content: [
          {
            image: logoImage,
            width: 200,
            hight: 200,
          },
          { text: "Sale Report", style: "header" },
          { text: "From:" + fromDate.substring(0, 10) },
          { text: "To:" + toDate.substring(0, 10) },
          "  ",
          "  ",
          {
            table: {
              body: [
                [
                  "date",
                  "customer",
                  "code",
                  "state",
                  "subTotal with tax",
                  "shipping",
                  "total",
                ],
                ...tableBody,
              ],
            },
          },
        ],
        styles: {
          header: {
            bold: true,
          },
        },
      };
      setTimeout(() => {
        pdfMake
          .createPdf(documentDefinition)
          .download(`${new Date().toDateString()} sale-report.pdf`);
      });
    }
  }
}

const logoImage =
  "data:image/jpeg;base64,";
